import React, { Component } from "react";
import { SideNavItem } from "react-materialize";
import { connect } from "react-redux";

import { authenticate, logout } from "../../redux/actions/index";

const mapStateToProps = state => {
    return { authenticated: state.authenticated, user: state.user };
};

function mapDispatchToProps(dispatch) {
    return {
        // authenticate: authenticated => dispatch(authenticate(authenticated))
        logout: dispatch(logout())
    };
}

class SideNavItems extends Component {
    handleLogout = e => {
        e.preventDefault()
        this.props.logout()
        // this.props.authenticate({
        //     authenticated: false,
        //     user: {
        //         email: "",
        //         name: "",
        //         phone: ""
        //     }
        // });
    };

    render() {
        const { authenticated, user } = this.props;

        return (
            <div>
                {authenticated ? (
                    <div>
                        <SideNavItem
                            user={{
                                background:
                                    "img/jeremy-bishop-BuQ-jgeexaQ-unsplash.jpg",
                                email: user.email,
                                name: user.name
                            }}
                            userView
                        />
                        <SideNavItem
                            href='/project'
                            icon='assignment_turned_in'
                        >
                            Projects
                        </SideNavItem>
                        <SideNavItem href='/business' icon='business'>
                            Business
                        </SideNavItem>
                        <SideNavItem divider />
                        {/* <SideNavItem subheader>My Account</SideNavItem> */}
                        <SideNavItem href='/users/me' waves icon='person_pin'>
                            Profile
                        </SideNavItem>
                        <SideNavItem
                            href='/logout'
                            onClick={this.handleLogout}
                            waves
                            icon='power_settings_new'
                        >
                            Logout
                        </SideNavItem>
                    </div>
                ) : (
                    <div>
                        <SideNavItem
                            user={{
                                background:
                                    "img/jeremy-bishop-BuQ-jgeexaQ-unsplash.jpg",
                                email: "Beeblee",
                                name: ""
                            }}
                            userView
                        />
                        <SideNavItem href='/login' waves icon='trending_flat'>
                            Login
                        </SideNavItem>
                    </div>
                )}
            </div>
        );
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(SideNavItems);
